import React from 'react';
import "../../css/Views/home.css"
import Footer from '../Components/Footer';
import Header from '../Components/Header';

 class Home extends React.Component {
    render() {
      return (
        <div id="home">
            <Header/>
            <Footer/>
        </div>
      )
    }
  }

  export default Home
